function MenuToggle() {
    var a = jQuery(window).width();
    var b = 1000
    if (a <= b) {
        jQuery("#menus ul") .parent('li') .addClass('sub-icon');
        jQuery("#menus ul") .hide();
    } else {
            jQuery("#menus ul,#menus") .show();
    }
}

